class UndergroundSystem(object):

    def __init__(self):
        self.stationInOut = {}

    def checkIn(self, id, stationName, t):
        """
        :type id: int
        :type stationName: str
        :type t: int
        :rtype: None
        """     
        #self.stationInOut[stationName].append(['in', id, t]) # 直接append会报某个key找不到
        if stationName in self.stationInOut.keys():
            self.stationInOut[stationName].append(['in', id, t])
        else:
            self.stationInOut[stationName] = [['in', id, t]]


    def checkOut(self, id, stationName, t):
        """
        :type id: int
        :type stationName: str
        :type t: int
        :rtype: None
        """
        if stationName in self.stationInOut.keys():
            self.stationInOut[stationName].append(['out', id, t])
        else:
            self.stationInOut[stationName] = [['out', id, t]]

            
    def getAverageTime(self, startStation, endStation):
        """
        :type startStation: str
        :type endStation: str
        :rtype: float
        """
        legaltrip = 0
        totaltime = 0
        for start in self.stationInOut[startStation]:
            if start[0] == 'out':
                continue
            for end in self.stationInOut[endStation]:
                # 这里假定不会有乘客坐两次。。。
                if end[0] == 'in' or end[1] != start[1]:
                    continue
                totaltime += (end[2]-start[2])
                legaltrip +=1
        return totaltime / legaltrip


